import React from 'react';



const Pad = (props) =>{
  return(
    <div onClick={props.sendKey}  className='drum-pad'>
      <audio src={props.paramSound} className="aud"></audio> 
      <button id='lmao' value={props.paramLetter} ref={props.audioRef}>{props.paramLetter}</button>
    </div>
  );
}


export default Pad;
